import { Route, Routes } from "react-router";
import { Layout } from "./Layout/Layout";
import { Home } from "./Home/Home";
import "./styles.css";

function App() {
  return (
    <>
      <Routes>
        <Route exact path="/">
          <Layout>
            <Home />
          </Layout>
        </Route>
        <Route path="/products">
          <Layout>
            <Products />
          </Layout>
        </Route>
      </Routes>
    </>
  );
}

export default App;
